import { Organization, Team, TeamMember } from './types';

export function parseOrgXML(xmlText: string): Organization {
    const parser = new DOMParser();
    const xmlDoc = parser.parseFromString(xmlText, 'text/xml');

    const teams: Team[] = Array.from(xmlDoc.getElementsByTagName('team')).map(teamNode => {
        const teamName = teamNode.getAttribute('name') || '';
        
        // Parse manager
        const managerNode = teamNode.getElementsByTagName('manager')[0];
        const manager: TeamMember = {
            name: managerNode.getElementsByTagName('name')[0].textContent || '',
            title: managerNode.getElementsByTagName('title')[0].textContent || '',
            imageUrl: managerNode.getElementsByTagName('imageUrl')[0]?.textContent || undefined,
            isManager: true
        };

        // Parse team members
        const membersNode = teamNode.getElementsByTagName('members')[0];
        const members: TeamMember[] = Array.from(membersNode.getElementsByTagName('member')).map(memberNode => ({
            name: memberNode.getElementsByTagName('name')[0].textContent || '',
            title: memberNode.getElementsByTagName('title')[0].textContent || '',
            imageUrl: memberNode.getElementsByTagName('imageUrl')[0]?.textContent || undefined,
            isManager: false
        }));

        return {
            name: teamName,
            manager,
            members
        };
    });

    return { teams };
}
